import React from "react";
import "./Nav.css"

class NavBar extends React.Component{
    render() {
      return (
        <nav>
            <ul>
                <img src="AirborneWhite.png" alt="Airborne Logo" height="50"/>
            </ul>
        </nav>
      )
    }
}

export default NavBar;
